description:
[(Company goal)] 
We aim to be a leader of Japanese food culture in the Netherlands, delivering happiness to all those we come into contact with.

{1.Mission} 
We promise to be committed to continued development and to ensure happiness to everybody who is involved in the company

{2.Vision} 
We dedicate ourselves to show the depth and profoundness of Japanese food

{3.Value} 
We aim for each individual employee to have a sense of commitment and self-responsibility, for the development of a stable and sustainable organisation.

{4.Way} 
As our company name, 'Sora' suggests,* we aim to create a work environment like a clear blue sky: transparent, clean and uplifting.

